import React from 'react';
import {ProductConsumer} from "../../context";
import CartItem from "./CartItem";

function CartList() {
    return (
        <ProductConsumer>
            {
                value => {

                    return (
                        <div className="container-fluid">
                            <div className="row">
                                <CartItem value={value} />
                            </div>
                        </div>
                    );
                }
            }
        </ProductConsumer>

    );
}

export default CartList();
